import React from "react";
import '../assets/css/TwoItem.css';
import ItemPro2 from './ItemPro2';
import PayCenter from '../components/PayCenter';
import ItemDivide from '../components/ItemDivide';
class TwoItem extends React.Component {
  // componentDidMount() {
  //   document.title = '开发中';
  //  }

  render() {
    const { itemData } = this.props;
    const dataProps_1={
      imgUrl:itemData&&itemData['goods_list']?itemData['goods_list'][0]['image']:null,
      oldPrice:itemData&&itemData['goods_list']?itemData['goods_list'][0]['price']:null,
      title:itemData&&itemData['goods_list']?itemData['goods_list'][0]['title']:null,
      url:itemData&&itemData['goods_list']?itemData['goods_list'][0]['url']:null,
    }
    const dataProps_2={
      imgUrl:itemData&&itemData['goods_list']?itemData['goods_list'][1]['image']:null,
      oldPrice:itemData&&itemData['goods_list']?itemData['goods_list'][1]['price']:null,
      title:itemData&&itemData['goods_list']?itemData['goods_list'][1]['title']:null,
      url:itemData&&itemData['goods_list']?itemData['goods_list'][1]['url']:null,
    }

    return (
      <div className="TwoItemMain">
        <div className="TwoItembox">
          <div className="left"><ItemPro2 isMain={this.props.fixMain?true:false} {...dataProps_1}/></div>
          <div className="center"><img src="/images/add.png" alt="add"/></div>
          <div className="right"><ItemPro2 {...dataProps_2}/></div>
        </div>
        <PayCenter price="126"/>
        <ItemDivide/>
      </div>
    );
  }
}

export default TwoItem;
